import React from 'react';
import './sass/css/banner.css';
import dataBanner from './BannerData';

export default function Banner() {
    return (
        <div container>
            {dataBanner.map((obj,index) => {
                return (
                    <div className="banner">
                        <img src={process.env.PUBLIC_URL+{}} alt="" />
                    </div>
                )
            })}
        </div>
    )
}
